        {name: 'name3', artist: 'artist3', album: 'album3', id: 3},
    ]
    }
  }

  render() {
  return (
    <div>
      <h1>Ja<span className="highlight">mmm</span>ing</h1>
      <div className="App">
        <SearchBar />
